script: |
  super -f text -I q4632.spq | sort > q4632.out

inputs:
  - name: q4632.spq
    data: |
      SELECT - col0 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE - ( + 39 ) * + 82 * + 75 + - col2 NOT IN ( + col1 );
  - name: tab0

outputs:
  - name: q4632.out
    data: |
      -15
      -87
      -97
